          nonceOffset: i + 1,
          actions: t.functionCalls.map((fc) =>
            functionCall(
              fc.methodName,
              fc.args,
              getGas(fc.gas),
              getAmount(fc.amount)
            )
          ),
        });
      })
    );

    return window.walletConnection.requestSignTransactions(nearTransactions);
  }

